column41:
h2. {color:#de350b}Current Situation: {color}

Currently we have observed when OGW is connected to OM-SV, Orders are getting stuck in OGW for Archiving Response. As Fast search call is going to Real OneDMS Env and can't find contract summary in system, we are getting empty fast search response from their side which is leading order stuck in OGW for 24 Fast search request (48 hours).
h2. {color:#de350b}Desired Solution:{color}

When OGW is connect to OM-SV, There should be possibility to connect to OneDMS-SV which will help to send Mock response back to OGW.
h2. {color:#de350b}Business Value:{color}

OGW will get Archiving (Fastsearch, SaveDocument) response from OneDMS-SV and order will get completed success status in OGW & Omnius application.

