We need someone with product catalog functional knowledge and Bundle Logic knowledge to explain why this test case is marked as failure?

My analysis: Analysis is done for test case "US 893 Service Address in GigaKombi Request DSL ILSBLU existingCustomerTN + Mobile ACQ GigaKombi ACQ Mobile ILS Fixed ILS Fixed". At the end of the comment is the request to the API and response of the API. The request contains one mobile and 2 fixed offer containers and API is responding back with below data:
 * "GigaKombi" bundle is possible between container 1 and 2: {color:#00875a}This looks functionally correct.{color}
 * SKUs KGKRED6UL, KVFAIO2MRK, KVFGSAIOHKaDV_8_4034 is to be added on Mobile offer container. {color:#00875a}This looks functionally correct.{color}
 * SKUs V0987TO and GS_R1_VoiceOption_9_99E[br]EOL is to be added on the fixed offer container. {color:#00875a}This looks functionally correct.{color}
 * No SKU to be removed. {color:#00875a}This looks functionally correct.{color}

From my analysis everything looks okay functionally in the API response and the test case should be passed, So we need someone with functional understanding of catalog and bundling rule to explain why this specific test case is marked as failure in Vodafone testing. Once we have this information we can analyze other failing test cases.

 

