column903:
12/Sep/24 11:59 AM;ariadne.thun1@vodafone.com;Feedback from Ran related to root cause analysis: 

We encountered a Kafka issue related to consumer group configuration. We have 3 envs that are using the same Kafka server but had different topics. However, they were all configured to use the same consumer group (name of the EG)

ACC env doesn’t have permission to access the Kafka resources for the other envs. As a result, the Kafka listener in ACC was unable to work correctly since it was trying to use the same consumer group as the one being used by other environments. To resolve this, we updated the configuration so that each environment uses a unique consumer group.;;;

