column901:
12/Sep/24 12:00 PM;ariadne.thun1@vodafone.com;Feedback from Ran regarding detailed root cause

We publish to Kafka from OGEG and we didn’t consider the case that we have 2 instances that are working at the same time. What happened is that we publish 2 times the same sos message (because in ACC we have 2 instances of OGEG in SIT we have 1) defects: (OS-61170, OS-61178)

The fix here is that only 1 instance of OGEG will have a running EG to publish to Kafka;;;

